és avec la variable d'environnement \u003Ccode>FOY_GROUPS\u003C/code>, liste séparée par des virgules d'uids de groupes)\u003C/p>",shortDescription:""},{name:"changelogs",displayName:"changelogs",includedItems:new Set(["ChangelogRelease","ReleaseChange","ReleaseChangesMap","acknowledgeChangelog","changelog","combinedChangelog","upcomingChangelog"]),rawDocumentation:"# Changelogs\n\nL'historique des versions de l'application.\nLes changelogs représentent les changements dans l'application web officielle également, et ne séparent pas les changements de l'API seul de ceux concernant l'application web.\n",documentation:"\u003Ch2>Changelogs\u003C/h2>\n\u003Cp>L'historique des versions de l'application.\nLes changelogs représentent les changements dans l'application web officielle également, et ne séparent pas les changements de l'API seul de ceux concernant l'application web.\u003C/p>",shortDescription:""},{name:"comments",displayName:"comments",includedItems:new Set(["Comment","deleteComment","upsertComment"]),rawDocumentation:"# Commentaires\n\nLes différents commentaires postés.\nLes commentaires peuvent être reliés à des [posts](../posts) ou des [documents](../documents)\n",documentation:"\u003Ch2>Commentaires\u003C/h2>\n\u003Cp>Les différents commentaires postés.\nLes commentaires peuvent être reliés à des \u003Ca href=\"../posts\">posts\u003C/a> ou des \u003Ca href=\"../documents\">documents\u003C/a>\u003C/p>",shortDescription:""},{name:"curriculum",displayName:"curriculum",includedItems:new Set(["Major","Minor","Subject","TeachingUnit","updateSubjectsExamDates","major","majors","minor","minorsOfMajor","minors","subject","subjectsOfMajor","subjectsOfMinor","subjects"]),rawDocumentation:"# Curriculum\n\nDifférentes matières enseignées dans les écoles, et leur organisation au sein de celle-ci.\n\nLa hiérarchie est la suivante:\n\n- [École](../schools)\n  - Filière (ou majeure): objet `Major`\n    - Parcours (ou mineure): objet `Minor`\n      - \"UE\" (Unité d'enseignement): objet `TeachingUnit`\n        - Matière: objet `Subject`\n\nCependant, afin de rendre les différents cas particuliers des écoles représentables, cette représentation se doit d'être la plus flexible possible.\n\nEn conséquence, une matière peut être reliée à:\n\n- une UE\n- une mineure\n- une majeure\n\nEt de même, une UE peut être reliée à:\n\n- une mineure\n- une majeure\n\nLa hiérarchie complète est donc plutôt la suivante:\n\n```\nSchool\n    Major\n        Subject\n        TeachingUnit\n        Minor\n            Subject\n            TeachingUnit\n                Subject\n```\n",documentation:"\u003Ch2>Curriculum\u003C/h2>\n\u003Cp>Différentes matières enseignées dans les écoles, et leur organisation au sein de celle-ci.\u003C/p>\n\u003Cp>La hiérarchie est la suivante:\u003C/p>\n\u003Cul>\n\u003Cli>\u003Ca href=\"../schools\">École\u003C/a>\n\u003Cul>\n\u003Cli>Filière (ou majeure): objet \u003Ccode>Major\u003C/code>\n\u003Cul>\n\u003Cli>Parcours (ou mineure): objet \u003Ccode>Minor\u003C/code>\n\u003Cul>\n\u003Cli>\"UE\" (Unité d'enseignement): objet \u003Ccode>TeachingUnit\u003C/code>\n\u003Cul>\n\u003Cli>Matière: objet \u003Ccode>Subject\u003C/code>\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003Cp>Cependant, afin de rendre les différents cas particuliers des écoles représentables, cette représentation se doit d'être la plus flexible possible.\u003C/p>\n\u003Cp>En conséquence, une matière peut être reliée à:\u003C/p>\n\u003Cul>\n\u003Cli>une UE\u003C/li>\n\u003Cli>une mineure\u003C/li>\n\u003Cli>une majeure\u003C/li>\n\u003C/ul>\n\u003Cp>Et de même, une UE peut être reliée à:\u003C/p>\n\u003Cul>\n\u003Cli>une mineure\u003C/li>\n\u003Cli>une majeure\u003C/li>\n\u003C/ul>\n\u003Cp>La hiérarchie complète est donc plutôt la suivante:\u003C/p>\n\u003Cpre>\u003Ccode>School\n    Major\n        Subject\n        TeachingUnit\n        Minor\n            Subject\n            TeachingUnit\n                Subject\n\u003C/code>\u003C/pre>",shortDescription:""},{name:"documents",displayName:"documents",includedItems:new Set(["DocumentSearchResult","DocumentType","Document","deleteDocumentFile","deleteDocument","mergeDocuments","setDocumentFileIsSolution","uploadDocumentFile","upsertDocument","document","documentsOfSubject","documents","searchDocuments"]),rawDocumentation:"---\ninline_types_from: [HealthCheck]\n---\n\n# Documents (La Frappe)\n\nDocuments publiés dans des [matières](../curriculum).\n\nNommé \"La Frappe\" au sein des écoles de Toulouse INP.\n",documentation:"\u003Chr>\n\u003Ch3>inline_types_from: [HealthCheck]\u003C/h3>\n\u003Ch2>Documents (La Frappe)\u003C/h2>\n\u003Cp>Documents publiés dans des \u003Ca href=\"../curriculum\">matières\u003C/a>.\u003C/p>\n\u003Cp>Nommé \"La Frappe\" au sein des écoles de Toulouse INP.\u003C/p>",shortDescription:""},{name:"events",displayName:"events",includedItems:new Set(["EventFrequency","EventManagerPowerLevel","EventManager","EventSearchResult","Event","ManagerOfEventInput","deleteEventManager","deleteEventPicture","deleteEvent","updateEventPicture","upsertEventManager","upsertEvent","upsertManagersOfEvent","eventManager","event","eventsInWeek","eventsOfGroup","events","registrationsOfEvent","searchEvents"]),rawDocumentation:"# Évènements\n\nLes différents évènements organisés par des [groupes](../groups).\n\nUn évènement peut, ou non, avoir des billets (et donc un système de billetterie).\n\nVoir [Billetterie](../ticketing) pour tout ce qui est billest et réservations.\n\n## URLs additionnelles\n\n\u003Carticle>\n##\n\nRenvoie un billet PDF d'une réservation ayant pour code `:code`.\n\n\u003C/article>\n",documentation:"\u003Ch2>Évènements\u003C/h2>\n\u003Cp>Les différents évènements organisés par des \u003Ca href=\"../groups\">groupes\u003C/a>.\u003C/p>\n\u003Cp>Un évènement peut, ou non, avoir des billets (et donc un système de billetterie).\u003C/p>\n\u003Cp>Voir \u003Ca href=\"../ticketing\">Billetterie\u003C/a> pour tout ce qui est billest et réservations.\u003C/p>\n\u003Ch3>URLs additionnelles\u003C/h3>\n\u003Cp>Renvoie un billet PDF d'une réservation ayant pour code \u003Ccode>:code\u003C/code>.\u003C/p>",shortDescription:""},{name:"forms",displayName:"forms",includedItems:new Set(["AnswerDate","AnswerFileUpload","AnswerInput","AnswerLongText","AnswerNumber","AnswerScale","AnswerSearchResult","AnswerSelectMultiple","AnswerSelectOne","AnswerText","AnswerTime","Answer","AnswersExportFormat","AnswersOfUser","FormSearchResult","FormSection","Form","QuestionFileUpload","QuestionKind","QuestionOptionInput","QuestionScalar","QuestionScaleInput","QuestionScale","QuestionSelectMultiple","QuestionSelectOne","Question","answerFileQuestion","answerFormSection","createLinkedGoogleSheet","mailFormAnswers","setFormAnswersCheckbox","upsertFormSection","upsertForm","upsertQuestion","allForms","formSection","form","forms","searchForms"]),rawDocumentation:"---\ninline_types: [QuestionScaleInput]\n---\n\n# Formulaires\n\nChurros propose un système de formulaires, à l'instar de Google Forms. Sert principalement à poser des questions supplémentaires lors d'une réservation d'un évènement, où à effectuer des sondages.\n",documentation:"\u003Chr>\n\u003Ch3>inline_types: [QuestionScaleInput]\u003C/h3>\n\u003Ch2>Formulaires\u003C/h2>\n\u003Cp>Churros propose un système de formulaires, à l'instar de Google Forms. Sert principalement à poser des questions supplémentaires lors d'une réservation d'un évènement, où à effectuer des sondages.\u003C/p>",shortDescription:""},{name:"gitlab",displayName:"gitlab",includedItems:new Set(["IssueComment","IssueState","Issue","createGitlabIssue","codeContributors","issue","issuesByUser"]),rawDocumentation:"# Gitlab\n\nRapports utilisateurs et crédits.\n\nChurros est interconnecté avec son dépôt pour tout ce qui concerne:\n\n- la gestion de rapports utilisateurs (signalement de bugs et propositions de fonctionnalités).\n- l'affichage de crédits et le badge \"développeur·euse\" sur les profils (développeur·euse·s ayant fait des commits)\n",documentation:"\u003Ch2>Gitlab\u003C/h2>\n\u003Cp>Rapports utilisateurs et crédits.\u003C/p>\n\u003Cp>Churros est interconnecté avec son dépôt pour tout ce qui concerne:\u003C/p>\n\u003Cul>\n\u003Cli>la gestion de rapports utilisateurs (signalement de bugs et propositions de fonctionnalités).\u003C/li>\n\u003Cli>l'affichage de crédits et le badge \"développeur·euse\" sur les profils (développeur·euse·s ayant fait des commits)\u003C/li>\n\u003C/ul>",shortDescription:""},{name:"global",displayName:"global",includedItems:new Set(["DateTime","Errors","File","MixedSearchResult","SortDirection","StringToIntMapping","Visibility","ZodError","buildInfo","search"]),rawDocumentation:"---\ninline_types_from: [ZodError]\nmanually_include:\n  queries: [node, nodes]\n  types: [Node, PageInfo, BuildInfo]\n---\n\n# Types globaux\n\nTypes utilisés au travers de tout l'API.\n",documentation:"\u003Chr>\n\u003Ch3>inline_types_from: [ZodError]\nmanually_include:\nqueries: [node, nodes]\ntypes: [Node, PageInfo, BuildInfo]\u003C/h3>\n\u003Ch2>Types globaux\u003C/h2>\n\u003Cp>Types utilisés au travers de tout l'API.\u003C/p>",shortDescription:""},{name:"groups",displayName:"groups",includedItems:new Set(["GroupMember","GroupSearchResult","GroupType","Group","addGroupMember","deleteGroupMember","deleteGroupPicture","deleteGroup","selfJoinGroup","updateGroupPicture","updateRoomOpenState","upsertGroupMember","upsertGroup","groupMembersCsv","group","groups","searchGroups"]),rawDocumentation:"# Groupes\n\nGroupes de personnnes: peut être un club, une association, un bureau d'[AE](../student-associations), un groupe d'intégration ou un simple groupe (parfois dit \"groupe informel\").\n",documentation:"\u003Ch2>Groupes\u003C/h2>\n\u003Cp>Groupes de personnnes: peut être un club, une association, un bureau d'\u003Ca href=\"../student-associations\">AE\u003C/a>, un groupe d'intégration ou un simple groupe (parfois dit \"groupe informel\").\u003C/p>",shortDescription:""},{name:"health-checks",displayName:"health-checks",includedItems:new Set(["HealthCheck","healthcheck"]),rawDocumentation:"# Health Checks\n\nDifférents \"health checks\" de l'application, des tests permettant de vérifier que l'application fonctionne correctement.\nIls sont utilisés pour monitorer que l'application est en bonne santé, et permet aussi d'exposer un endpoint /health dans l'application web.\n",documentation:"\u003Ch2>Health Checks\u003C/h2>\n\u003Cp>Différents \"health checks\" de l'application, des tests permettant de vérifier que l'application fonctionne correctement.\nIls sont utilisés pour monitorer que l'application est en bonne santé, et permet aussi d'exposer un endpoint /health dans l'application web.\u003C/p>",shortDescription:""},{name:"links",displayName:"links",includedItems:new Set(["LinkInput","Link"]),rawDocumentation:"# Liens\n\nLiens nommés, utilisés dans beaucoup de ressources différentes.\n\n## Organisation du code source\n\nLes codes des résolveurs respectifs sont dans chacun des modules concernés, et non ici.\n",documentation:"\u003Ch2>Liens\u003C/h2>\n\u003Cp>Liens nommés, utilisés dans beaucoup de ressources différentes.\u003C/p>\n\u003Ch3>Organisation du code source\u003C/h3>\n\u003Cp>Les codes des résolveurs respectifs sont dans chacun des modules concernés, et non ici.\u003C/p>",shortDescription:""},{name:"logs",displayName:"logs",includedItems:new Set(["LogEntry","logs"]),rawDocumentation:"# Logs\n\nLogs de l'application, accessibles uniquement par les administrateur·ice·s.\n",documentation:"\u003Ch2>Logs\u003C/h2>\n\u003Cp>Logs de l'application, accessibles uniquement par les administrateur·ice·s.\u003C/p>",shortDescription:""},{name:"notifications",displayName:"notifications",includedItems:new Set(["NotificationChannel","NotificationSubscriptionKeysInput","NotificationSubscription","Notification","deleteNotificationSubscription","sendNotification","testNotification","upsertNotificationSubscription","notificationSubscription","notificationSubscriptions","notification","notificationsSendCountForArticle","notifications"]),rawDocumentation:"---\ninline_types: [NotificationSubscriptionKeysInput]\n---\n\n# Notifications\n\nNotifications envoyées aux utilisateurs.\n",documentation:"\u003Chr>\n\u003Ch3>inline_types: [NotificationSubscriptionKeysInput]\u003C/h3>\n\u003Ch2>Notifications\u003C/h2>\n\u003Cp>Notifications envoyées aux utilisateurs.\u003C/p>",shortDescription:""},{name:"oauth",displayName:"oauth",includedItems:new Set(["ApiRateLimitHits","ApiUsageQueryType","ApiUsage","OAuth2ErrorCode","OAuth2Error","ThirdPartyApp","activateApp","authorize","deactivateApp","editApp","registerApp","revokeAuthorization","rotateAppSecret","allApps","myApps","thirdPartyApp"]),rawDocumentation:"---\ninline_types: [ThirdPartyAppResponse]\n---\n\n# Applications tierces (OAuth)\n\nChurros fournit un service de provider OAuth.\n\nDes applications tierces peuvent utiliser l'API de Churros au nom d'une personne, si celle-ci autorise l'application.\n\n## Endpoints utiles\n\n- **URL d'autorisation**: `https://churros.inpt.fr/authorize`\n- **URL d'obtention d'un token**: `https://churros.inpt.fr/token`\n- **URL d'obtention d'informations basiques sur l'utilisateur·ice connecté·e**: `https://churros.inpt.fr/identity`\n\n  Renvoie un JSON, contenant les informations suivantes:\n\n  - `uid`: nom d'utilisateur·ice unique (le \"@\")\n  - `email`: adresse email\n  - `ldapInternalEmail`: adresse email en `@bde.enseeiht.fr` (pour les n7iens)\n  - `fullName`: nom d'affichage\n  - `firstName`: prénom\n  - `lastName`: nom de famille\n  - `groupsUids`: uids des groupes dont l'utilisateur·ice est membre\n\nPour en savoir plus, voir la [documentation OAuth2 de Churros](https://wiki.inpt.fr/inp-net/public/oauth-churros)\n",documentation:"\u003Chr>\n\u003Ch3>inline_types: [ThirdPartyAppResponse]\u003C/h3>\n\u003Ch2>Applications tierces (OAuth)\u003C/h2>\n\u003Cp>Churros fournit un service de provider OAuth.\u003C/p>\n\u003Cp>Des applications tierces peuvent utiliser l'API de Churros au nom d'une personne, si celle-ci autorise l'application.\u003C/p>\n\u003Ch3>Endpoints utiles\u003C/h3>\n\u003Cul>\n\u003Cli>\n\u003Cp>\u003Cstrong>URL d'autorisation\u003C/strong>: \u003Ccode>https://churros.inpt.fr/authorize\u003C/code>\u003C/p>\n\u003C/li>\n\u003Cli>\n\u003Cp>\u003Cstrong>URL d'obtention d'un token\u003C/strong>: \u003Ccode>https://churros.inpt.fr/token\u003C/code>\u003C/p>\n\u003C/li>\n\u003Cli>\n\u003Cp>\u003Cstrong>URL d'obtention d'informations basiques sur l'utilisateur·ice connecté·e\u003C/strong>: \u003Ccode>https://churros.inpt.fr/identity\u003C/code>\u003C/p>\n\u003Cp>Renvoie un JSON, contenant les informations suivantes:\u003C/p>\n\u003Cul>\n\u003Cli>\u003Ccode>uid\u003C/code>: nom d'utilisateur·ice unique (le \"@\")\u003C/li>\n\u003Cli>\u003Ccode>email\u003C/code>: adresse email\u003C/li>\n\u003Cli>\u003Ccode>ldapInternalEmail\u003C/code>: adresse email en \u003Ccode>@bde.enseeiht.fr\u003C/code> (pour les n7iens)\u003C/li>\n\u003Cli>\u003Ccode>fullName\u003C/code>: nom d'affichage\u003C/li>\n\u003Cli>\u003Ccode>firstName\u003C/code>: prénom\u003C/li>\n\u003Cli>\u003Ccode>lastName\u003C/code>: nom de famille\u003C/li>\n\u003Cli>\u003Ccode>groupsUids\u003C/code>: uids des groupes dont l'utilisateur·ice est membre\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003Cp>Pour en savoir plus, voir la \u003Ca href=\"https://wiki.inpt.fr/inp-net/public/oauth-churros\">documentation OAuth2 de Churros\u003C/a>\u003C/p>",shortDescription:""},{name:"payments",displayName:"payments",includedItems:new Set(["LydiaAccount","PaymentMethod","ProfitsBreakdown","PromotionType","Promotion","claimPromotionCode","finishPaypalRegistrationPayment","upsertLydiaAccount","lydiaAccount","lydiaAccountsOfGroup","lydiaAccounts"]),rawDocumentation:"---\ninline_types_from: [ProfitsBreakdown]\n---\n\n# Paiements\n\nIntégrations avec différents prestatai u003Ccode>FOY_GROUPS\u003C/code>, liste séparée par des virgules d'uids de groupes)\u003C/p>",shortDescription:""},{name:"changelogs",displayName:"changelogs",includedItems:new Set(["ChangelogRelease","ReleaseChange","ReleaseChangesMap","acknowledgeChangelog","changelog","combinedChangelog","upcomingChangelog"]),rawDocumentation:"# Changelogs\n\nL'historique des versions de l'application.\nLes changelogs représentent les changements dans l'application web officielle également, et ne séparent pas les changements de l'API seul de ceux concernant l'application web.\n",documentation:"\u003Ch2>Changelogs\u003C/h2>\n\u003Cp>L'historique des versions de l'application.\nLes changelogs représentent les changements dans l'application web officielle également, et ne séparent pas les changements de l'API seul de ceux concernant l'application web.\u003C/p>",shortDescription:""},ML,{name:"curriculum",displayName:"curriculum",includedItems:new Set(["Major","Minor","Subject","TeachingUnit","updateSubjectsExamDates","major","majors","minor","minorsOfMajor","minors","subject","subjectsOfMajor","subjectsOfMinor","subjects"]),rawDocumentation:"# Curriculum\n\nDifférentes matières enseignées dans les écoles, et leur organisation au sein de celle-ci.\n\nLa hiérarchie est la suivante:\n\n- [École](../schools)\n  - Filière (ou majeure): objet `Major`\n    - Parcours (ou mineure): objet `Minor`\n      - \"UE\" (Unité d'enseignement): objet `TeachingUnit`\n        - Matière: objet `Subject`\n\nCependant, afin de rendre les différents cas particuliers des écoles représentables, cette représentation se doit d'être la plus flexible possible.\n\nEn conséquence, une matière peut être reliée à:\n\n- une UE\n- une mineure\n- une majeure\n\nEt de même, une UE peut être reliée à:\n\n- une mineure\n- une majeure\n\nLa hiérarchie complète est donc plutôt la suivante:\n\n```\nSchool\n    Major\n        Subject\n        TeachingUnit\n        Minor\n            Subject\n            TeachingUnit\n                Subject\n```\n",documentation:"\u003Ch2>Curriculum\u003C/h2>\n\u003Cp>Différentes matières enseignées dans les écoles, et leur organisation au sein de celle-ci.\u003C/p>\n\u003Cp>La hiérarchie est la suivante:\u003C/p>\n\u003Cul>\n\u003Cli>\u003Ca href=\"../schools\">École\u003C/a>\n\u003Cul>\n\u003Cli>Filière (ou majeure): objet \u003Ccode>Major\u003C/code>\n\u003Cul>\n\u003Cli>Parcours (ou mineure): objet \u003Ccode>Minor\u003C/code>\n\u003Cul>\n\u003Cli>\"UE\" (Unité d'enseignement): objet \u003Ccode>TeachingUnit\u003C/code>\n\u003Cul>\n\u003Cli>Matière: objet \u003Ccode>Subject\u003C/code>\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003Cp>Cependant, afin de rendre les différents cas particuliers des écoles représentables, cette représentation se doit d'être la plus flexible possible.\u003C/p>\n\u003Cp>En conséquence, une matière peut être reliée à:\u003C/p>\n\u003Cul>\n\u003Cli>une UE\u003C/li>\n\u003Cli>une mineure\u003C/li>\n\u003Cli>une majeure\u003C/li>\n\u003C/ul>\n\u003Cp>Et de même, une UE peut être reliée à:\u003C/p>\n\u003Cul>\n\u003Cli>une mineure\u003C/li>\n\u003Cli>une majeure\u003C/li>\n\u003C/ul>\n\u003Cp>La hiérarchie complète est donc plutôt la suivante:\u003C/p>\n\u003Cpre>\u003Ccode>School\n    Major\n        Subject\n        TeachingUnit\n        Minor\n            Subject\n            TeachingUnit\n                Subject\n\u003C/code>\u003C/pre>",shortDescription:""},{name:"documents",displayName:"documents",includedItems:new Set(["DocumentSearchResult","DocumentType","Document","deleteDocumentFile","deleteDocument","mergeDocuments","setDocumentFileIsSolution","uploadDocumentFile","upsertDocument","document","documentsOfSubject","documents","searchDocuments"]),rawDocumentation:"---\ninline_types_from: [HealthCheck]\n---\n\n# Documents (La Frappe)\n\nDocuments publiés dans des [matières](../curriculum).\n\nNommé \"La Frappe\" au sein des écoles de Toulouse INP , des tests permettant de vérifier que l'application fonctionne correctement.\nIls sont utilisés pour monitorer que l'application est en bonne santé, et permet aussi d'exposer un endpoint /health dans l'application web.\u003C/p>",shortDescription:""},{name:"links",displayName:"links",includedItems:new Set(["LinkInput","Link"]),rawDocumentation:"# Liens\n\nLiens nommés, utilisés dans beaucoup de ressources différentes.\n\n## Organisation du code source\n\nLes codes des résolveurs respectifs sont dans chacun des modules concernés, et non ici.\n",documentation:"\u003Ch2>Liens\u003C/h2>\n\u003Cp>Liens nommés, utilisés dans beaucoup de ressources différentes.\u003C/p>\n\u003Ch3>Organisation du code source\u003C/h3>\n\u003Cp>Les codes des résolveurs respectifs sont dans chacun des modules concernés, et non ici.\u003C/p>",shortDescription:""},{name:"logs",displayName:"logs",includedItems:new Set(["LogEntry","logs"]),rawDocumentation:"# Logs\n\nLogs de l'application, accessibles uniquement par les administrateur·ice·s.\n",documentation:"\u003Ch2>Logs\u003C/h2>\n\u003Cp>Logs de l'application, accessibles uniquement par les administrateur·ice·s.\u003C/p>",shortDescription:""},{name:"notifications",displayName:"notifications",includedItems:new Set(["NotificationChannel","NotificationSubscriptionKeysInput","NotificationSubscription","Notification","deleteNotificationSubscription","sendNotification","testNotification","upsertNotificationSubscription","notificationSubscription","notificationSubscriptions","notification","notificationsSendCountForArticle","notifications"]),rawDocumentation:"---\ninline_types: [NotificationSubscriptionKeysInput]\n---\n\n# Notifications\n\nNotifications envoyées aux utilisateurs.\n",documentation:"\u003Chr>\n\u003Ch3>inline_types: [NotificationSubscriptionKeysInput]\u003C/h3>\n\u003Ch2>Notifications\u003C/h2>\n\u003Cp>Notifications envoyées aux utilisateurs.\u003C/p>",shortDescription:""},{name:"oauth",displayName:"oauth",includedItems:new Set(["Api on d'informations basiques sur l'utilisateur·ice connecté·e\u003C/strong>: \u003Ccode>https://churros.inpt.fr/identity\u003C/code>\u003C/p>\n\u003Cp>Renvoie un JSON, contenant les informations suivantes:\u003C/p>\n\u003Cul>\n\u003Cli>\u003Ccode>uid\u003C/code>: nom d'utilisateur·ice unique (le \"@\")\u003C/li>\n\u003Cli>\u003Ccode>email\u003C/code>: adresse email\u003C/li>\n\u003Cli>\u003Ccode>ldapInternalEmail\u003C/code>: adresse email en \u003Ccode>@bde.enseeiht.fr\u003C/code> (pour les n7iens)\u003C/li>\n\u003Cli>\u003Ccode>fullName\u003C/code>: nom d'affichage\u003C/li>\n\u003Cli>\u003Ccode>firstName\u003C/code>: prénom\u003C/li>\n\u003Cli>\u003Ccode>lastName\u003C/code>: nom de famille\u003C/li>\n\u003Cli>\u003Ccode>groupsUids\u003C/code>: uids des groupes dont l'utilisateur·ice est membre\u003C/li>\n\u003C/ul>\n\u003C/li>\n\u003C/ul>\n\u003Cp>Pour en savoir plus, voir la \u003Ca href=\"https://wiki.inpt.fr/inp-net/public/oauth-churros\">documentation OAuth2 de Churros\u003C/a>\u003C/p>",shortDescription:""},{name:"payments",displayName:"payments",includedItems:new Set(["LydiaAccount","PaymentMethod","ProfitsBreakdown","PromotionType","Promotion","claimPromotionCode","finishPaypalRegistrationPayment","upsertLydiaAccount","lydiaAccount","lydiaAccountsOfGroup","lydiaAccounts"]),rawDocumentation:"---\ninline_types_from: [ProfitsBreakdown]\n---\n\n# Paiements\n\nIntégrations avec différents prestataires de paiements, notamment [Lydia](https://lydia-app.com) et [PayPal](https://paypal.com).\n",documentation:"\u003Chr>\n\u003Ch3>inline_types_from: [ProfitsBreakdown]\u003C/h3>\n\u003Ch2>Paiements\u003C/h2>\n\u003Cp>Intégrations avec différents prestataires de paiements, notamment \u003Ca href=\"https://lydia-app.com\">Lydia\u003C/a> et \u003Ca href=\"https://paypal.com\">PayPal\u003C/a>.\u003C/p>",shortDescription:""},{name:"posts",displayName:"posts",includedItems:new Set(["ArticleSearchResultType","Article","deleteArticlePicture","deleteArticle","updateArticlePictu
